class DataImport( interval: Int,split :String) extends Serializable{
    /**
     * Import packages
     **/ 
    import java.util.Locale
    import java.text.ParseException
    import java.text.SimpleDateFormat
    import com.github.nscala_time.time.Imports._
    import scala.util.{Success, Try}
    import scala.collection._
    import org.apache.spark.sql.catalyst.encoders.RowEncoder
    import org.apache.spark.sql.types._
    import org.apache.spark.sql.Row
    import org.apache.spark.sql.{DataFrame, Row, SQLContext, DataFrameReader}
    import java.sql.{Connection, DriverManager, ResultSet, Timestamp}
    import spark.implicits._
    import com.tdunning.math.stats.TDigest

    def this() = { this(10,"localhost") } 
    def this(interval: Int) = { this(interval,"localhost") } 
    def this(split:String) = { this(10, split) } 

    /**
     * data-type solving methods
    **/
    def DoubleSuccess(r :Try[Double] ) ={ 
        r match {       
            case Success(_) => true
            case _ =>  false
        }
    } 
    def toDouble (s : String) = {
        val result =DoubleSuccess(scala.util.Try(s.toDouble))
        if(result) s.toDouble else -1d
    }
    def toInt (s : String) =  {
        val result =DoubleSuccess(scala.util.Try(s.toDouble))
        if(result) s.toInt else -1.toInt
    }
    def toLong(s : String) =  {
        val result =DoubleSuccess(scala.util.Try(s.toDouble))
        if(result) s.toLong else -1.toLong
    }
    def toShort(s : String) =  {
        val result =DoubleSuccess(scala.util.Try(s.toDouble))
        if(result) s.toShort else -1.toShort
    } 

    def MapSplit(rdd : org.apache.spark.rdd.RDD[String]) = rdd.map(_.split(";").map(_.replace("\"",""))).filter(s=> s(0)!="id")

    /* get all the useful difinition table */
    val pre="/Users/lynnjiang/Desktop/intern/LB 7-8/ioeventlog/"
    val ioevent = MapSplit(sc.textFile(pre+"ioevent.csv")).map(s=>(s(0),s(1),toInt(s(2)),s(3),toShort(s(4)),s(5),toInt(s(6)))).toDF("id","iotypeid","eventno","descr","level","creationtime","eventtype").cache
    val iotype = MapSplit(sc.textFile(pre+"iotype.csv")).map(s=>(s(0),toInt(s(1)),s(2),s(3))).toDF("id","iotypeno","descr","creationtime").cache
    val machinetype = MapSplit(sc.textFile(pre+"machinetype.csv")).map(s=>(s(0),s(1),toInt(s(2)),s(3),s(5))).toDF("id","MTname","typeno","desc","creationtime").cache
    val machine =  MapSplit(sc.textFile(pre+"machine.csv")).map(s=>(s(0),s(1),s(2),s(3),s(4),s(5),s(6),s(7),s(8),s(9))).toDF("id","stationid","machinetypeid","groupid","address","pid","Mname","sn","ver","creationtime").cache
    val DicCatalog = MapSplit(sc.textFile(pre+"DicCatalog.csv")).map(s=>(s(0),s(1),s(2),s(3))).toDF("id","name","bindcode","descr").cache
    val dicitem = MapSplit(sc.textFile(pre+"dicItem.csv")).map(s=>(s(0),s(1),s(2),s(3),toInt(s(4)),toInt(s(5)))).toDF("id","dicid","DisplayMember","DataMember","Sorter","IsSysDefine").cache
    val realnode = MapSplit(sc.textFile(pre+"realnode.csv")).map(s=>(s(0),s(1),s(2),s(3),s(4),s(5),toInt(s(6)),toInt(s(7)),s(8),toInt(s(9)),s(10))).toDF("id","machineid","resourceid","iotypeid","Rname","Raddr","channel","inout","defaultiotypeid","precision","creationtime").cache
    val machineresource =  MapSplit(sc.textFile(pre+"machineresource.csv")).map(s=>(s(0),toInt(s(1)),s(2),toInt(s(3)),s(4),toInt(s(5)),s(6),s(7))).toDF("id","channel","machinetypeid","inout","defaultiotypeid","precision","name","creationtime").cache


    /**
     * all data map
     **/ 
    // private var dataMap = new scala.collection.mutable.HashMap[String,org.apache.spark.sql.DataFrame]
    /**
     * process time information map
    **/
    //private var proMap = new scala.collection.mutable.HashMap[String,org.apache.spark.sql.DataFrame]
    //case class processTimePer(time:String, avg:Double,per50:Double,per95:Double, per99:Double)
    //fix inner class creating errors for the class above
    //org.apache.spark.sql.catalyst.encoders.OuterScopes.addOuterScope(this)



    /**
     * get Maps of data
    **/
    //def getDataMap = dataMap 
    //def getProMap = proMap


    //id;fc;addr;iotypeno;eventno;eventvalue;time;triggerid;status;creationtime;eventtype;eventlevel
    /**
     * read file and transform data file into sql table
    **/
    def createTable(path: String)={
        //var accesslog = Seq.empty[(String, String, String, Integer, Long, Long)].toDF("ip","sortByTens","type","status","replySize","processTime")
        val pattern ="yyyy-MM-dd HH:mm:ss"  
        val format = new SimpleDateFormat(pattern,Locale.US) 
        val ioeventLogText = sc.textFile(pre+path)
        //val name = path.substring(0,path.indexOf(split)-1).replace('.','_')

        val ioeventLog = ioeventLogText.map(_.split(";").map(_.replace("\"",""))).filter(s=> s(0)!="id").map{s=>
            //var sortByTens = time.toString("HH:mm")
            //var secondTen = time.getSecondOfMinute()
            //secondTen = interval*(secondTen/interval).toInt
            //sortByTens = if(secondTen == 0) sortByTens + ":00" else sortByTens + ":"+secondTen
            //val id = s(0)
            val fc = s(1)
            val addr = s(2)
            var preaddr = s(2).substring(0,s(2).lastIndexOf('-'))
            val iotypeno = toInt(s(3))
            val eventno = toInt(s(4))
            val eventvalue = s(5)
            val time = new DateTime(format.parse(s(6)))
            val sortByHour = time.toString("yyyy-MM-dd HH")
            val triggerid = s(7)
            val status = toInt(s(8))
            //val creationtime = new DateTime(format.parse(former(9)))
            val eventtype = toInt(s(10))
            val eventlevel = toInt(s(11))
            (fc,addr,preaddr,iotypeno,eventno,eventvalue,sortByHour,triggerid,status,eventtype,eventlevel)  
        }
        ioeventLog.sortBy(_._7)
        //dataMap += ((name, accesslog))
        //accesslog.registerTempTable(name)
        //accesslog
    }

}

val di = new DataImport()
val ioeventlog = di.createTable("ioeventlog_0707.csv").toDF("fc","addr","preaddr","iotypeno","eventno","eventvalue","sortByHour","triggerid","status","eventtype","eventlevel").cache
